import './App.css';
import TableView from './layouts/tableView/TableView';
import React, {useState} from 'react';
import FormNewItem from './layouts/tableView/formNewItem/FormNewItem';

const App = () => {

    const [items, setItems] = useState(
      [
        { id:10, fullName: "Name10", phone: "+44 368 435", notes: "Note10"},
        { id:10, fullName: "Name10", phone: "+44 368 435", notes: "Note10"},
        { id:10, fullName: "Name10", phone: "+44 368 435", notes: "Note10"},
        { id:10, fullName: "Name10", phone: "+44 368 435", notes: "Note10"},
        { id:10, fullName: "Name10", phone: "+44 368 435", notes: "Note10"},
      ]
    );

const appendContact = (fullName, phone, notes) => {
  const temp = {
    id:10, 
    fullName: "Name10", 
    phone: "+44 368 435", 
    notes: "Note10"
  };
  setItems([...items, temp]);

}

  return (
    <div className='container mt-5'>
        <div className='card'> 
          <div className='card-header'>
            <h1>Contact List</h1>
          </div>
          <div className='card-body'>
            <TableView data = {items} />
            <FormNewItem addContact={appendContact}/>

          </div>
        </div>
       </div>

  );
}

export default App;
